static inline double approx_dist(double x, double y) 
{
  x = fabs(x);
  y = fabs(y);
  return ((x < y) ? y : x);
}

static double my_round(double f)
/* doesn't have to deal with negtive numbers */
{
  double d, frac;
  
  frac = modf(f, &d);

  if (frac >= 0.5)  
    d += 1.0;

  return d;
}

